        try:
            # Parse the grammar
            grammar_string = grammar.strip()

            # Check if the string is generated by the grammar
            for line in grammar_string.splitlines():
                line = line.strip()
                if line and line.startswith('S'):
                    try:
                        # Parse the grammar
                        grammar_parse = grammar.split('S')[1]

                        # Check if the string is generated by the grammar
                        if text in grammar_parse:
                            return True
                    except:
                        pass
            return False
        except Exception as e:
            print(f"Error parsing grammar: {e}")
            return False

    if is_generated(s, s):
        print("Yes")
    else:
        print("No")

